import React from "react";
import { ProductService, SectionList } from "../constant";
import SectionCard from "./SectionCard";

const Section = () => {
  return (
    <>
      <div className="w-full bg-gray-200 mb-10">
        <div className="grid md:grid-cols-2 lg:grid-cols-4 lg:px-16">
          {SectionList.map((item, i) => (
            <SectionCard key={i} data={item} />
          ))}
        </div>
      </div>
      <div class="flex items-center justify-center h-36">
        <div class="relative">
          <span class="absolute inset-0 flex items-center justify-center text-gray-300 lg:text-9xl text-6xl font-bold">
            SERVICES
          </span>
          <span class="relative text-black lg:text-3xl  text-xl font-medium mt-28">
            product service
          </span>
        </div>
      </div>
      <div>
        <p className="flex justify-center text-sm font-semibold mt-6  px-2">
          Omni-channel, all-scenario, multi-terminal store opening solutions
          help 90 million merchants succeed
        </p>
      </div>
      <div className="grid  lg:grid-cols-3 lg:px-16">
        {ProductService.map((item, i) => (
          <img src={item.imag} alt="Example" className="" />
        ))}
      </div>
    </>
  );
};

export default Section;
